import axios from 'axios';



function Row({title, fetchUrl, instance}) {
    const [movies, setMovies] = useState([])

    useEffect(() =>{

        async function fetchData() {
            const request = await axios.get(`${instance}${fetchUrl}`);
            console.log(request)
            return request;
        }
        fetchData();

    }, []);


    return (
        <div>
            <h2>{title}</h2>
        </div>
    )
}

export default Row
